webpackJsonp([0xc9217091746a],{1173:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Go to the Art Hall to open the Spring Festival party in Shanghai. I saw many acquaintances there. After talking a few words, two movies were released. One was called "City Love Story" in Shanghai. The reform and opening up was not too deep, but it was just like a movie.</p>\n<p>The other is a Russian film called "International Girl", which is a Russian girl who works as a nurse in the hospital and also does a flesh business. She then marries a Swede. After she goes abroad, she misses herself very much. Motherland. After reading it, I was very emotional. One such big country,</p>\n<p>The nationals got this point. There are several majestic Russian songs in the film, giving a feeling of tragicness. Against this kind of music, the main tone is very clear. A country is not strong, and it has no status in the international arena. The most unfortunate is its own nationals.</p>',id:"/home/swain/workspace/political-life/src/pages/en/0027.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/en/0027.md",frontmatter:{title:"Monday, February 7"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/en/0027.md absPath of file >>> MarkdownRemark"}}}});
